import api from "../../services/api";
import { Link } from "react-router-dom";

import "./styles.css";

export default class Main extends Component {
    render() {

        const {ngenre, genres} = this.state;

        const items = []

        for(const [index,value] of genres.entries()){
            items.push(<li key={index}>{Object.entries(value).map(([k,v]) => (
                k
            ))}</li>) 
        }

        return (
            <div className="main-page">
                <Link to="/genres/">Gêneros</Link>
                <h2>Numero de Gêneros: {ngenre}</h2>
                {items}
            </div>
        );
    }
};
